import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
  Routes
} from 'react-router-dom';
import First from './first/first';
import One from './wrapped/one';

function App() {
  return (
    <>
    <Router>
      <Routes>
      <Route path='/' element={<First />} exact />
      <Route path='/wrapped' element={<One></One>} exact />
      </Routes>
    </Router>
    </>
  );
}

export default App;
